import { useEffect, useState } from "react"

function Cateogiers(){
    const [data,setdata]=useState([])
    useEffect(()=>{
        fetch("http://localhost:9000/prodact")
        .then(res=>res.json())
        .then(data=>setdata())
    })
    return(
        <h1>Cateogiers</h1>
    )
}
export default Cateogiers
